import React from 'react'
const axios = require('axios');
const cheerio = require('cheerio');

async function scrapeLeetCodeProfile(username) {
  try {
    const url = `https://leetcode.com/${username}/`;

    const response = await axios.get(url);
    const $ = cheerio.load(response.data);

    // Extract the solved problems count
    const solvedCount = $('.user-casual-info .user-casual-item')
      .filter((index, element) => $(element).text().includes('Solved'))
      .find('.total-solved')
      .text()
      .trim();

    return {
      username,
      solvedCount,
    };
  } catch (error) {
    console.error('Error:', error.message);
    return null;
  }
}

// Replace 'your-leetcode-username' with the actual username you want to scrape
const leetCodeUsername = 'HARI_PRASAD_2003';

scrapeLeetCodeProfile(leetCodeUsername).then((userData) => {
  if (userData) {
    console.log(`LeetCode Profile for ${userData.username}`);
    console.log(`Solved Problems: ${userData.solvedCount}`);
  } else {
    console.log('Failed to fetch LeetCode profile data.');
  }
});


const DashBoard = () => {
  return (
    <div>DashBoard</div>
  )
}

export default DashBoard
